module.exports = [{"id":"glue","name":"Adhérence","enabled":true,"public":true,"pc":1,"short":"Peut marcher sur les murs et plafonds","description":"<p>Les extr&eacute;mit&eacute;s des membres du personnage adh&egrave;rent &agrave; n&#39;importe quelle surface lui permettant de se d&eacute;placer le long des murs et plafonds aussi rapidement que sur le sol.</p>"},{"id":"wings","name":"Ailes","enabled":true,"public":true,"pc":2,"short":"Peut se déplacer dans les airs","description":"<p>Le personnage poss&egrave;de une grande paire d&#39;ailes.</p>\r\n\r\n<p>Il peut se d&eacute;placer dans les airs &agrave; sa vitesse de d&eacute;placement habituelle.</p>"},{"id":"bicephalous","name":"Bicéphale","enabled":true,"public":true,"pc":4,"short":"Possède deux cerveaux indépendants","description":"<p>Le personnage poss&egrave;de deux cerveaux ind&eacute;pendants, il peut s&#39;agir&nbsp;de deux t&ecirc;tes, de deux organes dans le m&ecirc;me gros cr&acirc;ne, etc.</p>\r\n\r\n<p>Il est capable d&rsquo;utiliser 2 [capacit&eacute;s arcaniques](lexicon:ability) dans le m&ecirc;me tour. Il peut s&#39;agir de deux utilisations de la m&ecirc;me ou de deux diff&eacute;rentes.</p>"},{"id":"wound-I","name":"Blessure de degré I","enabled":true,"public":true,"pc":1,"short":"Inflige une blessure de degré I au contact","description":"<p>Le personnage poss&egrave;de des griffes, des canines ac&eacute;r&eacute;es ou n&rsquo;importe quelle excroissance capable de s&eacute;rieusement blesser ses adversaires.<br />\r\nIl se peut aussi que le personnage soit tout simplement un expert en art martial capable de viser des points l&eacute;taux.</p>\r\n\r\n<p>Dans tous les cas, le personnage est capable d&rsquo;infliger des [blessures](lexicon:wound) de degr&eacute; I au [contact](lexicon:contact) en r&eacute;ussissant un jet d&rsquo;[Imposer](characteristic:force).</p>"},{"id":"wound-II","name":"Blessure de degré II","enabled":true,"public":true,"pc":2,"short":"Inflige une blessure de degré II au contact","description":"<p>Le personnage poss&egrave;de des griffes, des canines ac&eacute;r&eacute;es ou n&rsquo;importe quelle excroissance capable de s&eacute;rieusement blesser ses adversaires.</p>\r\n\r\n<p>Dans tous les cas, le personnage est capable d&rsquo;infliger des [blessures](lexicon:wound) de degr&eacute; II au [contact](lexicon:contact) en r&eacute;ussissant un jet d&rsquo;[Imposer](characteristic:force).</p>"},{"id":"wound-III","name":"Blessure de degré III","enabled":true,"public":true,"pc":4,"short":"Inflige une blessure de degré III au contact","description":"<p>Le personnage poss&egrave;de des griffes, des canines ac&eacute;r&eacute;es ou n&rsquo;importe quelle excroissance capable de s&eacute;rieusement blesser ses adversaires.</p>\r\n\r\n<p>Dans tous les cas, le personnage est capable d&rsquo;infliger des [blessures](lexicon:wound) de degr&eacute; III au [contact](lexicon:contact) en r&eacute;ussissant un jet d&rsquo;[Imposer](characteristic:force).</p>"},{"id":"sonar","name":"Écholocalisation","enabled":true,"public":true,"pc":1,"short":"Possède une ouïe sur-développée","description":"<p>Le personnage poss&egrave;de un trait bestial lui conf&eacute;rant une excellente perception des sons.<br />\r\nCela lui permet de localiser avec une grande pr&eacute;cision les bruits environnant, d&#39;avoir conscience de la pr&eacute;sence d&#39;ennemis &agrave; distance, etc.</p>\r\n\r\n<p>Lorsqu&#39;il utilise un jet de [D&eacute;voiler](characteristic:reveal) pour [percevoir](skill:listening) un son, il poss&egrave;de un bonus de 3 points d&#39;[Instinct](lexicon:instinct) suppl&eacute;mentaires.</p>"},{"id":"night-vision","name":"Nyctalope","enabled":true,"public":true,"pc":1,"short":"Peut percevoir dans l'obscurité","description":"<p>Le personnage n&#39;est pas impact&eacute; par le manque de luminosit&eacute;.</p>\r\n\r\n<p>Il discerne tr&egrave;s bien les formes comme en plein jour &agrave; condition qu&#39;il y ait au moins une faible luminosit&eacute; mais ne per&ccedil;oit n&eacute;anmoins pas les couleurs. Dans le noir complet il reste aveugle.</p>"},{"id":"multiple-arms","name":"Paire de bras supplémentaire","enabled":true,"public":true,"pc":2,"short":"Possède deux paires de bras indépendantes","description":"<p>Le personnage poss&egrave;de quatre bras qu&#39;il peut manier par paires ind&eacute;pendantes.</p>\r\n\r\n<p>Il est capable d&rsquo;effectuer deux [attaques](skill:attack) &agrave; chaque [tour](lexicon:round).</p>\r\n\r\n<p>S&#39;il d&eacute;bloque des attributs physiques pour blesser, ils ne concernent qu&#39;une de ses paires de bras, il devra les d&eacute;bloquer &agrave; nouveau pour pouvoir profiter de cet avantage &agrave; chaque attaque.<br />\r\nDe m&ecirc;me, il doit&nbsp;poss&eacute;der une arme secondaire pour attaquer deux fois.<br />\r\nIl ne peut pas utiliser deux&nbsp;fois une de ses [capacit&eacute;s](lexicon:ability) dans le m&ecirc;me tour gr&acirc;ce &agrave; cela.</p>"},{"id":"hunter","name":"Pisteur","enabled":true,"public":true,"pc":1,"short":"Possède un odorat sur-développé","description":"<p>Le personnage poss&egrave;de un trait bestial lui conf&eacute;rant une excellente perception des odeurs.<br />\r\nCela lui permet de suivre la trace odorante d&#39;une cible, d&#39;avoir conscience de la pr&eacute;sence d&#39;ennemis &agrave; distance, etc.</p>\r\n\r\n<p>Il est capable de percevoir la pr&eacute;sence d&#39;un animal ou d&#39;un personnage [&agrave; distance](lexicon:range) et peut suivre une piste sur plusieurs kilom&egrave;tres.<br />\r\nSi la cible tente de camoufler son odeur gr&acirc;ce &agrave; un parfum ou en avan&ccedil;ant face au vent, le personnage peut tenter de la localiser avec un jet de [D&eacute;voiler](characteristic:reveal) avec&nbsp;un bonus de 3 points d&#39;[Instinct](lexicon:instinct) suppl&eacute;mentaires.</p>"},{"id":"eagle-eyes","name":"Vue perçante","enabled":true,"public":true,"pc":1,"short":"Possède une vue sur-développée","description":"<p>Le personnage poss&egrave;de un trait bestial lui conf&eacute;rant une excellente perception visuelle.<br />\r\nCela lui permet de voir tr&egrave;s loin, de d&eacute;celer des d&eacute;tails infimes dans son environnement, de percer &agrave; jour des camouflages subtiles, etc.</p>\r\n\r\n<p>Lorsqu&#39;il utilise un jet de [D&eacute;voiler](characteristic:reveal) pour [percevoir visuellement](skill:vision), il poss&egrave;de un bonus de 3 points d&#39;[Instinct](lexicon:instinct) suppl&eacute;mentaires.</p>"}]

